import "./index.css";
import SignIn from "./components/SignIn";
import UserData from "./components/UserData";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Register from "./components/userRegister/Register";
import RegisterdUserData from "./components/userRegister/RegisterdUserData";
import Profile from "./components/Profile";
import ProtectedRoute from "./ProtectedRoute";
import { useState } from "react";

function App() {
  const [isLoggedIn, setisLoggedIn] = useState(null);
  const logIn = () => {
    setisLoggedIn(true);
  };
  const logOut = () => {
    setisLoggedIn(false);
  };
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/login" EX element={<SignIn />}></Route>
          <Route path="/userdata" element={<UserData />} />
          <Route path="/register" element={<Register />} />
          <Route path="/registerdUser" element={<RegisterdUserData />} />
          {/* <Route path="/profile" element={<Profile />}/> */}
          <Route
            path="/"
            element={
              <ProtectedRoute isLoggedIn={isLoggedIn}>

                <Profile />
              </ProtectedRoute>
            }
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
